import React from 'react';
import {Card,Image,Icon} from 'semantic-ui-react';

export default (props)=>{
	for(let i=0;i<this.props.shows.length;i++){
		return(
			<Card>
				<Image />
				<Card.Content>
					<Card.Header> {this.props.showName} </Card.Header>
					<Card.Meta> {`${this.props.date} ${this.props.fromTime} ${this.props.toTime}`}</Card.Meta>
				</Card.Content>
				<Card.Content extra>
					<a>
						<Icon name='ethereum'/>
						{this.props.amount} ether
					</a>
				</Card.Content>
			</Card>
		)
	}
}
